# Simple Linux Terminal App to Display JPEG Image

import base64
import time
import os
import sys

# Base64 encoded JPEG image (placeholder)
jpeg_data = ""

def display_image(encoded_data):
    with open("image.jpg", "wb") as image_file:
        image_file.write(base64.b64decode(encoded_data))
    
    os.system("fim -w -H image.jpg")

if __name__ == "__main__":
    display_image(jpeg_data)
    time.sleep(30)
    os.remove("image.jpg")
    sys.exit(0)